建表语句:
CREATE TABLE `base_record_data` (
  `record_id` varchar(50) NOT NULL COMMENT '记录ID',
  `record_data` varchar(100) DEFAULT NULL COMMENT '记录数据内容',
  `record_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '数据创建时间',
  PRIMARY KEY (`record_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='临时表记录，用户记录数据';

CREATE TABLE `erd_relation_func`  (
  `new_func_pos` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '主键(设备pbs树功能位置码)',
  `func_pos` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'sap功能位置码',
  PRIMARY KEY (`new_func_pos`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '配置构型功能位置转换表' ROW_FORMAT = Dynamic;

CREATE TABLE `rml_fmeca_pbs_down`  (
  `id` bigint unsigned NOT NULL COMMENT '主键id',
  `obj_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '对象编码',
  `down_obj_code` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '上游对象编码',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = 'FMECA_pbs结构树_下游' ROW_FORMAT = Dynamic;

CREATE TABLE `rml_fmeca_pbs_up`  (
  `id` bigint unsigned NOT NULL COMMENT '主键id',
  `obj_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '对象编码',
  `up_obj_code` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '上游对象编码',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = 'FMECA_pbs结构树_上游' ROW_FORMAT = Dynamic;

CREATE TABLE `rml_pm_repair_tac_by3`  (
  `msr_cert_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '测量凭证id',
  `result` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'AS-found结果',
  `mpt_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '测量点编码',
  PRIMARY KEY (`msr_cert_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '预防管理措施_维修策略_测量点数据关系表' ROW_FORMAT = Dynamic;

CREATE TABLE `ccm_manage_report_attention_level` (
  `obj_code` varchar(100) NOT NULL COMMENT '对象编码',
  `attention_level` varchar(100) NOT NULL COMMENT '关注等级',
  PRIMARY KEY (`obj_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='CCM管理_对象关注等级表';

CREATE TABLE `ccm_manage_report_attention_level_mid` (
  `obj_code` varchar(100) NOT NULL COMMENT '对象编码',
  `attention_level_val` int NOT NULL COMMENT '关注等级:1高，2中，3低',
  `reason` varchar(100) NOT NULL COMMENT '原因',
  PRIMARY KEY (`obj_code`,`reason`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='CCM管理_对象关注等级中间表';

CREATE TABLE `ccm_manage_report_com_eff_eq` (
  `com_code` varchar(100) NOT NULL COMMENT '部件编码',
  `eq_code` varchar(100) NOT NULL COMMENT '设备编码',
  PRIMARY KEY (`com_code`,`eq_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='CCM管理_部件影响设备';
